export default defineEventHandler(async (event) => {
    const totalUsers = users.length
    const query = getQuery(event)
    const search = String(query.search)

    if (query.generateError) {
        throw createError({
            statusCode: 401,
            message: 'У вас недостаточно прав'
        })

    }

    const limit = parseInt(query.limit as string) || 20
    const page = parseInt(query.page as string) || 1
    const pages = Math.ceil(totalUsers / limit)
    const spliceStart = page === 1 ? 0 : (page * limit) - 1
    let results = users.slice(spliceStart, spliceStart + limit)

    if (search) {
        const searchResult = users.filter(user => user.first_name.toLowerCase().includes(String(search).toLowerCase()))
        results = searchResult.slice(spliceStart, spliceStart + limit)
    }

    return {
        count: totalUsers,
        page,
        total: pages,
        next: page === pages ? null : page + 1,
        previous: page <= 0 ? 1 : page - 1,
        results
    }
})
